import React from 'react';
import './photos.scss';
import Collection from './components/Collection';


function App() {
    const [collection, setCollection] = React.useState([])
    React.useEffect(() => {
        fetch('https://62ea7a82ad295463258d86d1.mockapi.io/city')
        .then((res) => res.json())
      .then((json) => {
        setCollection(json);
      })
      .catch((err) => {
        console.warn(err);
        alert('error ');
      })
   }, []);
  return (
    <div className='body_photos'>
    <div className="photos">
      <h1>Моя коллекция фотографий</h1>
      <div className="top">
        <ul className="tags">
          <li className="active">Все</li>
          <li>Горы</li>
          <li>Море</li>
          <li>Архитектура</li>
          <li>Города</li>
        </ul>
        <input className="search-input" placeholder="Поиск по названию" />
      </div>
      <div className="content_photos">
       {collection.map((obj) => (
        <Collection key={obj.index}
        name={obj.name}
        images={obj.photos}
      />
       ))} 
      </div>
      <ul className="pagination">
        <li>1</li>
        <li className="active">2</li>
        <li>3</li>
      </ul>
    </div>
    </div>
  );
}

export default App;
